import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';
import { useState } from 'react';
import React from 'react';


function App() {




  const sisu = data.map((item, index) => (
    <MainContent
      key={index}
      name={item.name}
      text={item.text}
      date={item.date}
      img={item.img}
      data={data}
    />
  ));
  const lisa = () => {
    return (
      <div>
        {data.map((item, index) => (
          <div key={index}>
            <p>{item.name}</p>
            <p>{item.date}</p>
          </div>
        ))}
      </div>
    );
  };
  const [count, setCount] = React.useState(0)

  const add = () => {
    setCount(prevCount => prevCount === 5 ? 10 : prevCount + 1);
  }
  const subs = () => {
    setCount(count - 1)
  }
  const [qst, setQst] = React.useState("yes")
  let muuda = () => {
    setQst(prevQst => prevQst === "yes" ? "no" : "yes")
  }

  const [kalakutta, setKalakutta] = React.useState(["kalakutta1", "kalakutta2"])

  const Lisa = () => {
    setKalakutta(prev => {
      return [...prev, `Kalakutta ${kalakutta.length + 1}`]
    })
  }
  const randomNumber = (min, max) => {
    return Math.floor(Math.random() * (max - min) + min)
  }


  return (
    <div className="App">
      {qst}
      <button onClick={Lisa}>Add Item</button>

      {kalakutta.map(item => {
        return (
          <p key="item" id={randomNumber(1, 10000000)}>{item}</p>)
      }
      )
      }



      <div>Calculator
        <p onClick={muuda}>{count}</p>
        <button onClick={add}>Add</button>
        <button onClick={subs}>substract</button>
      </div>
      {sisu}

    </div>
  );
}

export default App;
